import React from "react"
import { Container, Nav } from "react-bootstrap"
import { Outlet } from "react-router-dom"
import Navbar from "./Navbar"

function App() {
  return (
    <div className="App">
      <Container style={{ maxWidth: "960px" }}>
        <h1>Werds</h1>
        <Navbar />
        <Outlet />
      </Container>
    </div>
  )
}

export default App

